import React from 'react';

function Header(props) {
    
    function goToAdd(){
        navigate("/new-user");
    }

    return ( 
       <header>
            <h1>Siteweb des Utilisateurs</h1>
            <button onClick={goToAdd} className='btn-add-user'>
                <img src="icons/add.png" alt="add"/>
                <p>CREER UTILISATEUR</p>
            </button>
       </header>
     );
}

export default Header;
